import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

import Home from '@/pages/home'
import Search from '@/pages/search'
import Login from '@/pages/login'
import Register from '@/pages/Register'
export default new VueRouter({
    routes:[
        {
            path:'/Home',
            component:Home
        },
        {
            path:'/Search',
            component:Search
        },
        {
            path:'/login',
            component:Login
        },
        {
            path:'/Register',
            component:Register
        }

    ]
})
